import React from 'react';
import PuanTablosu from './components/PuanTablosu';
import LaLigaTablosu from './components/LaLigaTablosu';
import SerieATablosu from './components/SerieATablosu';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Futbol Ligleri Puan Durumu</h1>
      </header>
      <main>
        <PuanTablosu />
        <LaLigaTablosu />
        <SerieATablosu />
      </main>
    </div>
  );
}

export default App;
